    false,nt"url": null,nt"notes": "This GIS layer depicts wetlands designated
    for protection in the state of Iowa. Designated wetland is defined in Iowa Code
    subsection 459.102(21) as follows: 21. "Designated wetland" means land designated
    as a protected wetland by the United States department of the interior or the department
    of natural resources, including but not limited to a protected wetland as defined
    in section 456B.1, if the land is owned and managed by the federal government or
    the department of natural resources. However, a designated wetland does not include
    land where an agricultural drainage well has been plugged causing a temporary wetland
    or land within a drainage district or levee district. As referenced in the foregoing
    definition, protected wetland is defined in Iowa Code subsection 456B.1(4) as follows:
    4. "Protected wetlands" means type 3, type 4, and type 5 wetlands as described
    in circular 39, Wetlands of the United States, 1971 Edition, published by the United
    States department of the interior. However, a protected wetland does not include
    land where an agricultural drainage well has been plugged causing a temporary wetland
    or land within a drainage district or levee district. Wetlands: An area of two or
    more acres in a natural condition that is mostly under water or waterlogged during
    the spring growing season and is characterized by vegetation of hydric soils.",nt"license_title":
